response.interests:
Широкая специализация:
• рекламные ролики;
• презентационные (промо, обзоры, видеоэкскурсии, презентации продукта или компании);
• анимационные;
• киноформат (музыкальные клипы, backstage, истории, документальные фильмы, корпоративные фильмы);
• съемка событий (мероприятия, концерты, выступления, соревнования, шоу, дефиле, праздники – в т.ч. свадьбы);
• интервью, репортажи;
• обучающие ролики (мастер-классы, конференции, семинары, тренинги);
• вирусные ролики;
• прямые трансляции, в т.ч. с нескольких камер (на экран, сайт, в соц.сети – Youtube, Facebook, ВКонтакте);
